import logo from './logo.svg'
import './App.css'
import { useEffect, useState } from 'react'
import pokemonproject from './Assets/pokemonproject.png'

function App() {
  let sprite
  const [pokemonList, setPokemonList] = useState([])

  useEffect(() => {
    fetch('https://pokeapi.co/api/v2/pokemon/?limit=20')
      .then((response) => response.json())
      .then((data) => {
        console.log(data.results)
        setPokemonList(data.results)
      })
      .catch((err) => {
        console.log(err.message)
      })
  }, [])

  useEffect(() => {
    fetch('https://pokeapi.co/api/v2/pokemon-form/1')
      .then((response) => response.json())
      .then((data) => {
        console.log(data.sprites.front_default)
        sprite = data.sprites.front_default
      })
      .catch((err) => {
        console.log(err.message)
      })
  }, [])

  return (
    <div className="App">
      <div className="LeftPanel">
        <img src={pokemonproject} className="Logo" alt="Pokemon Logo" />
        <img src={sprite} />
      </div>
      <div className="RightPanel">
        {pokemonList?.map(function (data) {
          return <div className="pokemonNameDiv"> {data.name}</div>
        })}
      </div>
    </div>
  )
}

export default App
